webpackJsonp([341473874934624e4],{"./node_modules/json-loader/index.js!./.cache/json/miscellaneous-how-to-remove-a-submodule-in-git.json":function(e,o){e.exports={data:{markdownRemark:{html:"<p>Removing a submodule is useful when it is no longer required. The steps below outline the removal of a submodule.</p>\n<h2>Remove Submodule</h2>\n<ul>\n<li>Delete the section referring to the submodule from the <code>.gitmodules</code> file</li>\n<li>Stage the changes via <code>git add .gitmodules</code></li>\n<li>Delete the relevant section of the submodule from <code>.git/config</code>.</li>\n<li>Run <code>git rm --cached path_to_submodule</code> (no trailing slash)</li>\n<li>Run <code>rm -rf .git/modules/path_to_submodule</code></li>\n<li>Commit the changes with `git commit -m “Removed submodule ”</li>\n<li>Delete the now untracked submodule files <code>rm -rf path_to_submodule</code></li>\n</ul>\n<h2>Sources</h2>\n<ul>\n<li><a href='http://stackoverflow.com/questions/1260748/how-do-i-remove-a-submodule' target='_blank' rel='nofollow'>Stackoverflow — How do I remove a submodule</a></li>\n<li><a href='https://git.wiki.kernel.org/index.php/GitSubmoduleTutorial#Removal' target='_blank' rel='nofollow'>git.wiki.kernel.org — Git submodule removal</a></li>\n</ul>",fields:{slug:"/miscellaneous/how-to-remove-a-submodule-in-git/"},frontmatter:{title:"How to Remove a Submodule in Git"}}},pathContext:{slug:"/miscellaneous/how-to-remove-a-submodule-in-git/"}}}});
